import React from 'react'
import { Link } from 'react-router-dom';

function Menubar() {
    return (
        <div className="menu_bar">
            <Link to='/'></Link>
            <Link to='/gallery'></Link>
            <Link to='/contact'></Link>
        </div>
    )
}

export default Menubar
